        </div>
    )


}

export const AdminMenu = () =>{

    const navigate = useNavigate()
    const { getSession, logout } = useContext(AccountContext);


    const signOut = (e) =>{
        e.preventDefault()
        logout();
        navigate('/')
    }

    return (
        <div>
            You are logged in.
